ascinating!\n&W2}2350.172}2}11&B2410.593}Un'Goro Crater}?&B2513.765}Tanaris}?&B2821.687}Orgrimmar}?&IRenew&K1}1}1&J2871.062}1}346}201&B4431.984}The Barrens}?&B4568.031}Mulgore}?&B4610.797}Thunder Bluff}?&B4634.093}Mulgore}?&B4685.500}Desolace}?&",
