88&J2691.000}20}227}227&J2691.000}21}227}227&J2691.000}23}227}227&J2691.000}24}227}227&J2691.140}20}25}25&J2691.140}21}25}25&J2691.140}23}25}25&J2691.140}24}25}25&J2692.187}21}88}88&J2692.187}23}88}88&J2692.203}24}88}88&J2692.234}21}91}91&J2692.234}23}91}91&J2692.234}24}91}91&J2693.203}21}88}88&J2693.203}23}88}88&J2693.203}24}88}88&J2694.172}21}25}25&J2694.172}22}37}37&J2694.172}24}37}37&J2695.156}21}136}136&J2695.156}22}91}91&J2695.234}21}88}88&J2695.234}22}88}88&J2695.750}14}252}126&J2696.218}21}88}88&J2696.218}22}88}88&J2696.218}23}88}67&J2697.281}21}88}88&J2697.281}22}88}88&J2698.156}21}91}91&J2698.156}22}91}91&J2698.156}23}91}48&J2699.203}21}185}185&J2699.203}22}185}185&J2699.203}23}185}47&E2699.718}0&E2723.218}1&E2741.718}0&E2782.718}1&E2790.718}0&FGeologist Larksbane&TStaghelm and his armies were clearly overwhelmed as the endless flow of Rajaxx's troops poured into Silithus. It would seem as if Staghelm, however, was more than just a nuisance to the Qiraji. Under Staghelm, the whole of the night elf armies had come together to defend Kalimdor, greatly slowing the Qiraji forces.\n&W2}2931.203}2}2&TVek'nilash and Vek'lor, known as the Twin Emperors of Ahn'Qiraj, watched the war from the sanctuary of their temple. The clever brothers devised a plan to demoralize and divide Staghelm's forces. &W2}2955.375}2}3&TValstann Staghelm served as the right hand of Fandral. A proud and noble warrior, his dedication and adoration for his father unyielding... and the Twin Emperors sensed this as weakness. A weakness that could be exploited.\n&W2}2967.547}2}4&TThe Qiraji forces were commanded to fall back and hide the bulk of their numbers beneath the sands of the desert. A small attack was ordered upon Southwind Village while the front lines of Staghelm's army were kept occupied.&W2}2979.593}2}5&TValstann, eager to please his father, convinced Fandral to allow him to take a small battalion to the defense of Southwind. Surely with the tide of battle turning their way, no harm could come to his beloved child. The trap was missed. Valstann was captured by the hiding Qiraji and Southwind Village obliterated. Rajaxx himself would take the captive Valstann to the front lines of the battle where - in front of Staghelm and the night elf forces - he would brutally execute the young night elf.\n&W2}2991.687}2}6&TThe war continued but the will of the great leader was sapped. The whole of Silithus was soon engulfed by the silithid and their Qiraji hosts.&W2}3003.781}2}7&TPoor man, this explains so much.&W2}3012.781}2}8&TThe night elf army was pushed back through Un'Goro, to the borders of the Tanaris desert. Something in Un'Goro prevented the Qiraji from being able to take the land. I do not quite understand this word but I believe it to mean 'God Lands.' It is stated that they could not 'take the God Lands.' \n&W2}3015.922}2}9&B3025.203}Orgrimmar}?&FThrall&THonor your heroes! On this day, they have dealt a great blow against one of our most hated enemies! The false Warchief, Rend Blackhand, has fallen!&W1}3053.828}3}10&TBe bathed in my power! Drink in my might! Battle for the glory of the Horde!&W1}3063.828}3}11&K7}143}143&J3189.437}27}361}361&FDoras&TArrrhhh...Guards!&W1}3501.484}4}12&W1}4116.125}4}12&W1}4726.547}4}12&",
